import React from 'react';
import styled from 'styled-components/macro';

import CategoryButton from './CategoryButton.js';
import categories from './data/categories.js';

// import Overlay from './Overlay.js';

export default function CategoryButtons (
  {children,
    makeAppear0,
    makeAppear1,
    makeAppear2,
    makeAppear3,
    makeAppear4,
    makeAppear5,
    makeAppear6,
    makeAppear7,
    makeAppear8,
    makeAppear9,
    makeAppear10,
    makeAppear11,
    makeAppear12,
    makeAppear13,
    makeAppear14})
  {


  return (
    <div>
      <Spacer />
        <CategoryButtonArea>
          <CategoryButton style={{content: categories[0]}} onClick={makeAppear0}></CategoryButton>
          <CategoryButton onClick={makeAppear1}>{categories[1]}</CategoryButton>
          <CategoryButton onClick={makeAppear2}>{categories[2]}</CategoryButton>
          <CategoryButton onClick={makeAppear3}>{categories[3]}</CategoryButton>
          <CategoryButton onClick={makeAppear4}>{categories[4]}</CategoryButton>
          <CategoryButton onClick={makeAppear5}>{categories[5]}</CategoryButton>
          <CategoryButton onClick={makeAppear6}>{categories[6]}</CategoryButton>
          <CategoryButton onClick={makeAppear7}>{categories[7]}</CategoryButton>
          <CategoryButton onClick={makeAppear8}>{categories[8]}</CategoryButton>
          <CategoryButton onClick={makeAppear9}>{categories[9]}</CategoryButton>
          <CategoryButton onClick={makeAppear10}>{categories[10]}</CategoryButton>
          <CategoryButton onClick={makeAppear11}>{categories[11]}</CategoryButton>
          <CategoryButton onClick={makeAppear12}>{categories[12]}</CategoryButton>
          <CategoryButton onClick={makeAppear13}>{categories[13]}</CategoryButton>
          <CategoryButton onClick={makeAppear14}>{categories[14]}</CategoryButton>
        </CategoryButtonArea>
    </div>
  )
}

const CategoryButtonArea = styled.div`
  display: grid;
  color: white;
  grid-template-rows: 1fr 1fr 1fr 1fr 1fr;
  grid-template-columns: 1fr 1fr 1fr;
  justify-items: center;
  gap: 30px 20px;
  margin-top: 20vw;
  margin-bottom: 10vw;
  background-color: rgba(0,0,0,0);
`

const Spacer = styled.div`
  height: 10vw;
  opacity: 0;
`
